    name: string;
    age: number;
}

function printPerson(person: Person) {
    console.log(person);
}

printPerson({ name: 'John', age: 20 });
printPerson({ name: 'Jane', age: 21 });


function printValue(value: string | number) {
    console.log(value);
}

printValue('Hello');
printValue(123);

function createUser(name: string, age: number) {
    return {
        name,
        age,
    };
}

